    .rccs__card--hipercard .rccs__card__background {
      background: linear-gradient(25deg, #8b181b, #de1f27); }
    .rccs__card--hipercard .rccs__issuer {
      background-image: url("data:image/svg+xml;base64,"); }
    .rccs__card--jcb .rccs__issuer {
