  .rccs__number {
    clear: both;
    font-family: "Consolas", "Courier", monospace;
    font-size: 20px;
    left: 10%;
    position: absolute;
    top: 45%; }
    .rccs__number.rccs__number--large {
      font-size: 17px; }
  .rccs__name {
    bottom: 15%;
    font-family: "Consolas", "Courier", monospace;
    font-size: 17px;
    left: 10%;
    line-height: 1;
    overflow: hidden;
    position: absolute;
    text-align: left;
    text-overflow: ellipsis;
    text-transform: uppercase;
    width: 60%; }
  .rccs__expiry {
    bottom: 15%;
    font-size: 0;
    line-height: 1;
    position: absolute;
    right: 10%; }
    .rccs__expiry > * {
      vertical-align: middle; }
    .rccs__expiry__valid {
      font-size: 10px;
      margin-bottom: 5px; }
    .rccs__expiry__value {
      font-family: "Consolas", "Courier", monospace;
      font-size: 16px; }
  .rccs__number, .rccs__name, .rccs__expiry, .rccs__cvc {
    opacity: 0.5;
    transition: opacity 0.3s; }
  .rccs__chip {
    background-image: url("data:image/svg+xml;base64,");
    background-repeat: no-repeat;
    background-size: contain;
    height: 26.36364px;
    left: 10%;
    position: absolute;
    top: 10%;
    width: 41.42857px; }
  .rccs__issuer {
    background-position: top right;
    background-repeat: no-repeat;
    background-size: contain;
    height: 23%;
    position: absolute;
    right: 10%;
    top: 10%;
    width: 40%; }
  .rccs__stripe {
    background-color: #2a1d16;
    height: 22%;
    left: 0;
    position: absolute;
    top: 9%;
    width: 100%; }
  .rccs__signature {
    background: repeating-linear-gradient(0.1deg, #fff 20%, #fff 40%, #fea 40%, #fea 44%, #fff 44%);
    height: 18%;
    left: 5%;
    position: absolute;
    top: 35%;
    width: 75%; }
  .rccs__cvc {
    color: #222;
    font-family: "Consolas", "Courier", monospace;
    font-size: 14px;
    left: 67%;
    line-height: 1;
    position: absolute;
    top: 42%; }
  .rccs__cvc__front {
    font-family: "Consolas", "Courier", monospace;
    font-size: 11.9px;
    opacity: 0;
    position: absolute;
    right: 10%;
    top: 38%;
    visibility: hidden; }
  .rccs--filled {
    opacity: 0.8 !important; }
  .rccs--focused {
    font-weight: 700;
    opacity: 1 !important; }
